import { useEffect, useState } from "react"
import {useParams} from "react-router-dom"
function ProdactDetetils(){
    let {Id}=useParams()
    const[Data,setData]=useState([])
    useEffect(()=>{
        fetch(`http://localhost:9000/prodact/${Id}`)
        .then(res=>res.json())
        .then(data=>setData(data))

    })
    
    return(
<h1>
    The Id Is  {Data.id}
</h1>
    )
}
export default ProdactDetetils
